import {Link} from 'react-router-dom';
import RandomNumberComponent from "./RandomNumberComponent";

const Page3 = () => {

return (
<div>
    <h1> Page 3 - Random Number Game ! </h1>


    <RandomNumberComponent/>
    <Link to='/page1'> Link To Page 1 </Link>
    </div>
)


}
export default Page3
